import { lazy, useContext, useEffect, useRef, useState } from 'react'
import { ThemContex } from '../App'
import Family from '../components/Family'
import AnimatedImage from '../components/AnimatedImage'


export default function Home() {
  const them = useContext(ThemContex)

  const [state, setState] = useState(false)
  const [desc, setDesc] = useState('exaple@gmail.com')
  const [num, setNum] = useState(0)
  const [users, setUser] = useState([])
  const [load, setLoading] = useState(true)
  const [show, setShow] = useState('')

  const members = [
    { id: 1, name: 'Soheil', lastname: 'Rostami' },
    { id: 2, name: 'Sofia', lastname: 'Eskandari' },
    { id: 3, name: 'Kasra', lastname: 'Rostami' }
  ]

  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(res => res.json())
      .then(data => setUser(data))
      .finally(setLoading(false))
  }, [])

  useEffect(() => {
    setInterval(() => {
      setNum(w => w + 1)
    }, 1500);
    // if (num % 2 === 0) {
    //   setShow('برندت رو بسپار به ما')

    // } else {
    //   setShow('با ثبت نام در لینک زیر شانس برنده شدن با شماست ')
    // }
  }, [])


  const onChange = (e) => {
    setDesc(e.target.value)
  }

  // if(true) {
  //   return <h1>Loading</h1>
  // }

  
  return (
    <div style={them}>
      <div style={{ backgroundColor: 'green', height: '60px', textAlign: 'center', margin: 'auto' }}>
        {/* tablighat */}
        <div className='tablighat' >
          {num%2==0 ? 'برندت رو بسپار به ما' : 'با ثبت نام در لینک زیر شانس برنده شدن با شماست '}
        </div>
      </div>
      <h3>Home pageee</h3>
      <div>
        {load ? (
          <div>Loading...</div> // اینجا می‌توانید انیمیشن یا اسپینر بگذارید
        ) : (
          <ol>
            {users.map(user => (
              <li key={user.id}>{user.name}</li>
            ))}
          </ol>
        )}
      </div>

      <button onClick={() => setState(!state)}>{state ? 'ثبت اطلاعات' : 'ویرایش اطلاعات'}</button>
      <div>
        {state ? <input type='email' onChange={onChange} value={desc} /> : <p>{desc}</p>}

      </div>

      {members.map((member) => (
        <div key={member.id}>
          <Family {...member} />
          {/* <hr /> */}
        </div>
      ))}
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>
      <hr />
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>
      <AnimatedImage alt={'car'} src={'data:image/jpeg;base64,'}/>

    </div>
  )
}


